/*Table structure for table `srampos_orders_archival` */

DROP TABLE IF EXISTS `srampos_orders_archival`;

CREATE TABLE `srampos_orders_archival` (
  `id` int(11) NOT NULL DEFAULT '0',
  `order_type` tinyint(4) NOT NULL,
  `customer_request` tinyint(4) NOT NULL,
  `table_id` bigint(20) NOT NULL,
  `seats_id` bigint(20) NOT NULL,
  `split_id` varchar(255) CHARACTER SET utf8 NOT NULL,
  `order_status` varchar(55) CHARACTER SET utf8 NOT NULL,
  `order_from` enum('web','app') CHARACTER SET utf8 NOT NULL,
  `date` datetime NOT NULL COMMENT 'transaction date',
  `created_on` datetime NOT NULL,
  `reference_no` varchar(55) CHARACTER SET utf8 NOT NULL,
  `customer_id` int(11) NOT NULL,
  `customer` varchar(55) CHARACTER SET utf8 NOT NULL,
  `biller_id` int(11) NOT NULL,
  `biller` varchar(55) CHARACTER SET utf8 NOT NULL,
  `warehouse_id` int(11) DEFAULT NULL,
  `note` varchar(1000) CHARACTER SET utf8 DEFAULT NULL,
  `staff_note` varchar(1000) CHARACTER SET utf8 DEFAULT NULL,
  `total` decimal(25,6) NOT NULL,
  `recipe_discount` decimal(25,6) DEFAULT '0.000000',
  `manual_item_discount` decimal(25,2) NOT NULL,
  `manual_item_discount_val` varchar(10) CHARACTER SET utf8 NOT NULL,
  `order_discount_id` varchar(20) CHARACTER SET utf8 DEFAULT NULL,
  `total_discount` decimal(25,6) DEFAULT '0.000000',
  `order_discount` decimal(25,6) DEFAULT '0.000000',
  `recipe_tax` decimal(25,6) DEFAULT '0.000000',
  `order_tax_id` int(11) DEFAULT NULL,
  `order_tax` decimal(25,6) DEFAULT '0.000000',
  `total_tax` decimal(25,6) DEFAULT '0.000000',
  `shipping` decimal(25,6) DEFAULT '0.000000',
  `grand_total` decimal(25,6) NOT NULL,
  `sale_status` varchar(20) CHARACTER SET utf8 DEFAULT NULL,
  `payment_status` varchar(20) CHARACTER SET utf8 DEFAULT NULL,
  `payment_term` tinyint(4) DEFAULT NULL,
  `due_date` date DEFAULT NULL,
  `order_cancel_id` tinyint(4) NOT NULL COMMENT 'order cancelled update used id',
  `order_cancel_status` tinyint(1) NOT NULL COMMENT '1->cancelled,0->not cancelled',
  `order_cancel_note` varchar(250) CHARACTER SET utf8 NOT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `total_items` smallint(6) DEFAULT NULL,
  `pos` tinyint(1) NOT NULL DEFAULT '0',
  `paid` decimal(25,6) DEFAULT '0.000000',
  `return_id` int(11) DEFAULT NULL,
  `surcharge` decimal(25,6) NOT NULL DEFAULT '0.000000',
  `attachment` varchar(55) CHARACTER SET utf8 DEFAULT NULL,
  `return_sale_ref` varchar(55) CHARACTER SET utf8 DEFAULT NULL,
  `sale_id` int(11) DEFAULT NULL,
  `return_sale_total` decimal(25,6) NOT NULL DEFAULT '0.000000',
  `rounding` decimal(10,6) DEFAULT NULL,
  `suspend_note` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `api` tinyint(1) DEFAULT '0',
  `shop` tinyint(1) DEFAULT '0',
  `address_id` int(11) DEFAULT NULL,
  `reserve_id` int(11) DEFAULT NULL,
  `hash` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `manual_payment` varchar(55) CHARACTER SET utf8 DEFAULT NULL,
  `cgst` decimal(25,6) DEFAULT NULL,
  `sgst` decimal(25,6) DEFAULT NULL,
  `igst` decimal(25,6) DEFAULT NULL,
  `table_whitelisted` tinyint(4) NOT NULL,
  `ordered_by` enum('steward','customer') CHARACTER SET utf8 NOT NULL,
  `waiter_id` tinyint(4) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

