/*Table structure for table `srampos_recipe` */

DROP TABLE IF EXISTS `srampos_recipe`;

CREATE TABLE `srampos_recipe` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `recipe_standard` varchar(40) DEFAULT NULL COMMENT '1-dine in,2-bbq,3-door delivery,4-takeaway',
  `special_item` tinyint(4) NOT NULL,
  `code` varchar(50) NOT NULL,
  `name` char(255) NOT NULL,
  `khmer_name` varchar(255) NOT NULL,
  `khmer_image` text NOT NULL,
  `piece` bigint(20) NOT NULL,
  `unit` int(11) DEFAULT NULL,
  `uom_per_qty` int(11) NOT NULL,
  `cost` decimal(25,6) DEFAULT NULL,
  `price` decimal(25,6) DEFAULT NULL,
  `stock_quantity` bigint(20) NOT NULL,
  `manufacturem_date` date NOT NULL,
  `expriy_date` date NOT NULL,
  `alert_quantity` decimal(15,6) DEFAULT '0.000000',
  `image` varchar(255) DEFAULT 'no_image.png',
  `category_id` int(11) NOT NULL,
  `subcategory_id` int(11) DEFAULT NULL,
  `cf1` varchar(255) DEFAULT NULL,
  `cf2` varchar(255) DEFAULT NULL,
  `cf3` varchar(255) DEFAULT NULL,
  `cf4` varchar(255) DEFAULT NULL,
  `cf5` varchar(255) DEFAULT NULL,
  `cf6` varchar(255) DEFAULT NULL,
  `quantity` decimal(15,6) DEFAULT '0.000000',
  `tax_rate` int(11) DEFAULT NULL,
  `track_quantity` tinyint(1) DEFAULT '1',
  `details` varchar(1000) DEFAULT NULL,
  `warehouse` int(11) DEFAULT NULL,
  `kitchens_id` bigint(20) NOT NULL,
  `currency_type` varchar(255) NOT NULL,
  `barcode_symbology` varchar(55) NOT NULL DEFAULT 'code128',
  `file` varchar(100) DEFAULT NULL,
  `recipe_details` text,
  `tax_method` tinyint(1) DEFAULT '0',
  `tax_amount` decimal(15,6) NOT NULL DEFAULT '0.000000',
  `type` varchar(55) NOT NULL DEFAULT 'standard',
  `supplier1` int(11) DEFAULT NULL,
  `supplier1price` decimal(25,6) DEFAULT NULL,
  `supplier2` int(11) DEFAULT NULL,
  `supplier2price` decimal(25,6) DEFAULT NULL,
  `supplier3` int(11) DEFAULT NULL,
  `supplier3price` decimal(25,6) DEFAULT NULL,
  `supplier4` int(11) DEFAULT NULL,
  `supplier4price` decimal(25,6) DEFAULT NULL,
  `supplier5` int(11) DEFAULT NULL,
  `supplier5price` decimal(25,6) DEFAULT NULL,
  `promotion` tinyint(1) DEFAULT '0',
  `promo_price` decimal(25,6) DEFAULT NULL,
  `start_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `supplier1_part_no` varchar(50) DEFAULT NULL,
  `supplier2_part_no` varchar(50) DEFAULT NULL,
  `supplier3_part_no` varchar(50) DEFAULT NULL,
  `supplier4_part_no` varchar(50) DEFAULT NULL,
  `supplier5_part_no` varchar(50) DEFAULT NULL,
  `sale_unit` int(11) DEFAULT NULL,
  `purchase_unit` int(11) DEFAULT NULL,
  `brand` int(11) DEFAULT NULL,
  `slug` varchar(55) DEFAULT NULL,
  `featured` tinyint(1) DEFAULT NULL,
  `weight` decimal(10,6) DEFAULT NULL,
  `hsn_code` int(11) DEFAULT NULL,
  `views` int(11) NOT NULL DEFAULT '0',
  `hide` tinyint(1) NOT NULL DEFAULT '0',
  `active` tinyint(1) NOT NULL,
  `preparation_time` int(11) DEFAULT NULL,
  `supplier` int(11) NOT NULL,
  `minimum_quantity` bigint(20) NOT NULL,
  `reorder_quantity` bigint(20) NOT NULL,
  `type_expiry` varchar(10) NOT NULL,
  `value_expiry` bigint(20) NOT NULL,
  `purchase_cost` varchar(100) NOT NULL,
  `maximum_quantity` int(11) NOT NULL,
  `purchase_tax` varchar(100) NOT NULL,
  `batch_required` tinyint(4) NOT NULL,
  `expiry_date_required` tinyint(4) NOT NULL,
  `suppliers` varchar(200) NOT NULL,
  `ingredients_mapping` tinyint(1) NOT NULL DEFAULT '0',
  `item_customizable` tinyint(4) NOT NULL,
  `variants` tinyint(4) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `category_id` (`category_id`),
  KEY `id` (`id`),
  KEY `id_2` (`id`),
  KEY `category_id_2` (`category_id`),
  KEY `unit` (`unit`),
  KEY `brand` (`brand`)
) ENGINE=InnoDB AUTO_INCREMENT=474 DEFAULT CHARSET=utf8;

