/*Table structure for table `srampos_settings` */

DROP TABLE IF EXISTS `srampos_settings`;

CREATE TABLE `srampos_settings` (
  `setting_id` int(1) NOT NULL,
  `logo` varchar(255) NOT NULL,
  `logo2` varchar(255) NOT NULL,
  `logo3` varchar(255) NOT NULL,
  `site_name` varchar(55) NOT NULL,
  `language` varchar(20) NOT NULL,
  `default_warehouse` int(2) NOT NULL,
  `accounting_method` tinyint(4) NOT NULL DEFAULT '0',
  `default_currency` varchar(3) NOT NULL,
  `default_tax_rate` int(2) NOT NULL,
  `rows_per_page` int(2) NOT NULL,
  `version` varchar(10) NOT NULL DEFAULT '1.0',
  `default_tax_rate2` int(11) NOT NULL DEFAULT '0',
  `dateformat` int(11) NOT NULL,
  `time_format` int(2) NOT NULL,
  `transfer_prefix` varchar(20) DEFAULT NULL,
  `login_group_required` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1-required,0-not required',
  `returnp_prefix` varchar(20) DEFAULT NULL,
  `discount_method` tinyint(4) NOT NULL,
  `login_warehouse_required` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1-required,0-not required',
  `tax2` tinyint(4) NOT NULL,
  `product_discount` tinyint(1) NOT NULL DEFAULT '0',
  `restrict_calendar` tinyint(4) NOT NULL DEFAULT '0',
  `overselling` tinyint(1) NOT NULL DEFAULT '0',
  `restrict_user` tinyint(4) NOT NULL DEFAULT '0',
  `bbq_display_items` bigint(20) NOT NULL,
  `product_serial` tinyint(4) NOT NULL,
  `iwidth` int(11) NOT NULL DEFAULT '0',
  `default_discount` int(11) NOT NULL,
  `socket_enable` int(11) NOT NULL,
  `timezone_gmt` varchar(255) NOT NULL,
  `fb_page_id` varchar(200) NOT NULL,
  `iheight` int(11) NOT NULL,
  `twidth` int(11) NOT NULL,
  `theight` int(11) NOT NULL,
  `watermark` tinyint(1) DEFAULT NULL,
  `reg_ver` tinyint(1) DEFAULT NULL,
  `mailpath` varchar(55) DEFAULT '/usr/sbin/sendmail',
  `protocol` varchar(20) NOT NULL DEFAULT 'mail',
  `allow_reg` tinyint(1) DEFAULT NULL,
  `quote_prefix` varchar(20) DEFAULT NULL,
  `smtp_port` varchar(10) DEFAULT '25',
  `smtp_crypto` varchar(10) DEFAULT NULL,
  `transaction_date` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1-auto,2-manual',
  `smtp_pass` varchar(255) DEFAULT NULL,
  `return_prefix` varchar(20) DEFAULT NULL,
  `purchase_prefix` varchar(20) DEFAULT NULL,
  `corn` datetime DEFAULT NULL,
  `customer_group` int(11) NOT NULL,
  `default_email` varchar(100) NOT NULL,
  `mmode` tinyint(1) NOT NULL,
  `bc_fix` tinyint(4) NOT NULL DEFAULT '0',
  `auto_detect_barcode` tinyint(1) NOT NULL DEFAULT '0',
  `captcha` tinyint(1) NOT NULL DEFAULT '1',
  `reference_format` tinyint(1) NOT NULL DEFAULT '1',
  `racks` tinyint(1) DEFAULT '0',
  `attributes` tinyint(1) NOT NULL DEFAULT '0',
  `product_expiry` tinyint(1) NOT NULL DEFAULT '0',
  `decimals` tinyint(2) NOT NULL DEFAULT '2',
  `exchange_decimals` tinyint(2) NOT NULL,
  `qty_decimals` tinyint(2) NOT NULL DEFAULT '2',
  `decimals_sep` varchar(2) NOT NULL DEFAULT '.',
  `thousands_sep` varchar(2) NOT NULL DEFAULT ',',
  `invoice_view` tinyint(1) DEFAULT '0',
  `default_biller` int(11) DEFAULT NULL,
  `srampos_username` varchar(50) DEFAULT NULL,
  `purchase_code` varchar(100) DEFAULT NULL,
  `rtl` tinyint(1) DEFAULT '0',
  `each_spent` decimal(15,6) DEFAULT NULL,
  `ca_point` tinyint(4) DEFAULT NULL,
  `each_sale` decimal(15,6) DEFAULT NULL,
  `sa_point` tinyint(4) DEFAULT NULL,
  `update` tinyint(1) DEFAULT '0',
  `sac` tinyint(1) DEFAULT '0',
  `display_all_products` tinyint(1) DEFAULT '0',
  `display_symbol` tinyint(1) DEFAULT NULL,
  `symbol` varchar(50) DEFAULT NULL,
  `remove_expired` tinyint(1) DEFAULT '0',
  `barcode_separator` varchar(2) NOT NULL DEFAULT '_',
  `set_focus` tinyint(1) NOT NULL DEFAULT '0',
  `price_group` int(11) DEFAULT NULL,
  `barcode_img` tinyint(1) NOT NULL DEFAULT '1',
  `ppayment_prefix` varchar(20) DEFAULT 'POP',
  `disable_editing` smallint(6) DEFAULT '90',
  `qa_prefix` varchar(55) DEFAULT NULL,
  `update_cost` tinyint(1) DEFAULT NULL,
  `apis` tinyint(1) NOT NULL DEFAULT '0',
  `state` varchar(100) DEFAULT NULL,
  `pdf_lib` varchar(20) DEFAULT 'dompdf',
  `dine_in` tinyint(1) NOT NULL,
  `take_away` tinyint(1) NOT NULL,
  `door_delivery` tinyint(1) NOT NULL,
  `first_level` bigint(20) NOT NULL,
  `second_level` bigint(20) NOT NULL,
  `qsr` tinyint(4) NOT NULL,
  `customer_discount_request` tinyint(1) NOT NULL,
  `nagative_stock_production` tinyint(1) NOT NULL,
  `nagative_stock_sale` tinyint(1) NOT NULL,
  `excel_header_color` varchar(7) NOT NULL,
  `excel_footer_color` varchar(7) NOT NULL,
  `installed_date` datetime NOT NULL,
  `site_expiry_date` date NOT NULL,
  `bill_reset` int(11) NOT NULL DEFAULT '0' COMMENT '0-none,1-daily,2-weekly,3-monthly',
  `billnumber_reset` int(11) NOT NULL DEFAULT '0' COMMENT '0-none,1-daily,2-weekly,3-monthly',
  `recipe_time_management` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0-OFF,1- ON',
  `default_preparation_time` int(11) NOT NULL,
  `night_audit_rights` tinyint(1) NOT NULL,
  `night_audit_with_open_sales` tinyint(1) NOT NULL,
  `customer_discount` varchar(100) NOT NULL,
  `manual_item_discount` tinyint(1) NOT NULL,
  `bbq_discount` varchar(255) NOT NULL,
  `bbq_enable` tinyint(4) NOT NULL,
  `bbq_adult_price` varchar(255) NOT NULL DEFAULT '0',
  `bbq_child_price` varchar(255) NOT NULL DEFAULT '0',
  `bbq_kids_price` varchar(255) NOT NULL DEFAULT '0',
  `socket_host` varchar(200) NOT NULL,
  `enable_qrcode` tinyint(4) NOT NULL,
  `bbq_covers_limit` int(11) NOT NULL,
  `backup_path` varchar(200) NOT NULL,
  `fb_page_access_token` text NOT NULL,
  `financial_yr_from` varchar(200) NOT NULL,
  `notification_time_interval` int(11) NOT NULL,
  `bill_request_notify_no_of_times` int(11) NOT NULL,
  `socket_port` int(11) NOT NULL,
  `financial_yr_to` varchar(200) NOT NULL,
  `procurment` tinyint(4) NOT NULL,
  `store_type` tinyint(4) NOT NULL COMMENT '1-single store,0-multi store',
  `special_item_enable` tinyint(4) NOT NULL,
  `enable_barcode` tinyint(4) NOT NULL,
  `fb_app_id` varchar(200) NOT NULL,
  `ftp_autobackup_enable` tinyint(4) NOT NULL,
  `notification_start_interval` int(11) NOT NULL,
  `default_store` int(11) NOT NULL,
  `discount_request_customer_app` tinyint(4) NOT NULL,
  `order_request_stewardapp` tinyint(4) NOT NULL,
  `ftp_instance_name` varchar(200) NOT NULL,
  `fb_secret_token` varchar(200) NOT NULL,
  `module_permission` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1-group,2-user',
  `supply_chain` tinyint(4) NOT NULL,
  `sales_prefix` varchar(20) DEFAULT NULL,
  `payment_prefix` varchar(20) DEFAULT NULL,
  `reg_notification` tinyint(1) DEFAULT NULL,
  `bill_number_start_from` varchar(100) NOT NULL,
  `delivery_prefix` varchar(20) DEFAULT NULL,
  `theme` varchar(20) NOT NULL,
  `item_addition` tinyint(1) NOT NULL DEFAULT '0',
  `expense_prefix` varchar(20) DEFAULT NULL,
  `tax1` tinyint(4) NOT NULL,
  `rough_tender` tinyint(4) NOT NULL,
  `timezone` varchar(100) DEFAULT NULL,
  `auto_reg` tinyint(1) DEFAULT NULL,
  `bbq_notify_no_of_times` int(11) NOT NULL,
  `bbq_return_notify_no_of_times` int(11) NOT NULL,
  `archival` tinyint(4) DEFAULT '0',
  `archival_days` int(11) DEFAULT '0',
  `smtp_host` varchar(100) DEFAULT NULL,
  `smtp_user` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`setting_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

