/*Table structure for table `srampos_variants` */

DROP TABLE IF EXISTS `srampos_variants`;

CREATE TABLE `srampos_variants` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(55) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `srampos_variants` */

/*Table structure for table `srampos_version_update_history` */

DROP TABLE IF EXISTS `srampos_version_update_history`;

CREATE TABLE `srampos_version_update_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `version` varchar(200) NOT NULL,
  `time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `srampos_version_update_history` */

/*Table structure for table `srampos_voucher` */

DROP TABLE IF EXISTS `srampos_voucher`;

CREATE TABLE `srampos_voucher` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `amount` decimal(26,6) NOT NULL,
  `points` bigint(20) NOT NULL,
  `vaild_days` bigint(20) NOT NULL DEFAULT '1',
  `min_balance` decimal(26,6) NOT NULL,
  `status` tinyint(4) NOT NULL,
  `create_on` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `srampos_voucher` */

/*Table structure for table `srampos_warehouses` */

DROP TABLE IF EXISTS `srampos_warehouses`;

CREATE TABLE `srampos_warehouses` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(50) NOT NULL,
  `name` varchar(255) NOT NULL,
  `address` varchar(255) NOT NULL,
  `map` varchar(255) DEFAULT NULL,
  `phone` varchar(55) DEFAULT NULL,
  `email` varchar(55) DEFAULT NULL,
  `type` tinyint(4) NOT NULL COMMENT '0-warehouse,1-store',
  `parent_warehouses` varchar(200) NOT NULL,
  `price_group_id` int(11) NOT NULL,
  `this_store` int(11) NOT NULL,
  `last_update` datetime NOT NULL,
  `sync_time` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

